const t=JSON.parse('{"key":"v-fbcb0500","path":"/00_Inbox/MySQL%20%E8%87%AA%E5%A2%9E%E4%B8%BB%E9%94%AE%E4%B8%80%E5%AE%9A%E6%98%AF%E8%BF%9E%E7%BB%AD%E7%9A%84%E5%90%97%EF%BC%9F.html","title":"MySQL 自增主键一定是连续的吗？","lang":"zh-CN","frontmatter":{"title":"MySQL 自增主键一定是连续的吗？","tag":["MySQL"],"description":"MySQL 自增主键一定是连续的吗？ 自增主键的特点就是 当表中新增一条记录时，主键值会根据自增步长自动叠加，通常会将自增步长设置为 1，也就是说自增主键值是连续的 自增值存储机制 在 MySQL 5.7 以及之前的版本，自增值保存在内存里 每次重启后，第一次打开表的时候，都会去找自增值的最大值 max (id)，然后将 max (id) + 1 作为这个表当前的自增值 在 MySQL 8.0 版本，将自增值的变更记录在了 redo log 中，重启的时候依靠 redo log 恢复重启之前的值","head":[["meta",{"property":"og:url","content":"https://logycoconut.github.io/00_Inbox/MySQL%20%E8%87%AA%E5%A2%9E%E4%B8%BB%E9%94%AE%E4%B8%80%E5%AE%9A%E6%98%AF%E8%BF%9E%E7%BB%AD%E7%9A%84%E5%90%97%EF%BC%9F.html"}],["meta",{"property":"og:title","content":"MySQL 自增主键一定是连续的吗？"}],["meta",{"property":"og:description","content":"MySQL 自增主键一定是连续的吗？ 自增主键的特点就是 当表中新增一条记录时，主键值会根据自增步长自动叠加，通常会将自增步长设置为 1，也就是说自增主键值是连续的 自增值存储机制 在 MySQL 5.7 以及之前的版本，自增值保存在内存里 每次重启后，第一次打开表的时候，都会去找自增值的最大值 max (id)，然后将 max (id) + 1 作为这个表当前的自增值 在 MySQL 8.0 版本，将自增值的变更记录在了 redo log 中，重启的时候依靠 redo log 恢复重启之前的值"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2024-07-02T07:58:30.000Z"}],["meta",{"property":"article:author","content":"logycoconut"}],["meta",{"property":"article:tag","content":"MySQL"}],["meta",{"property":"article:modified_time","content":"2024-07-02T07:58:30.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"MySQL 自增主键一定是连续的吗？\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2024-07-02T07:58:30.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"logycoconut\\",\\"url\\":\\"https://github.com/logycoconut\\"}]}"]]},"headers":[{"level":3,"title":"自增值存储机制","slug":"自增值存储机制","link":"#自增值存储机制","children":[]},{"level":3,"title":"导致自增值不连续的原因","slug":"导致自增值不连续的原因","link":"#导致自增值不连续的原因","children":[]}],"git":{"createdTime":1719907110000,"updatedTime":1719907110000,"contributors":[{"name":"logycoconut","email":"logycoconut@foxmail.com","commits":1}]},"readingTime":{"minutes":1.97,"words":591},"filePathRelative":"00_Inbox/MySQL 自增主键一定是连续的吗？.md","localizedDate":"2024年7月2日","excerpt":"<h1> MySQL 自增主键一定是连续的吗？</h1>\\n<blockquote>\\n<p>自增主键的特点就是<br>\\n当表中新增一条记录时，主键值会根据自增步长自动叠加，通常会将自增步长设置为 1，也就是说自增主键值是连续的</p>\\n</blockquote>\\n<h3> 自增值存储机制</h3>\\n<ul>\\n<li>在 MySQL 5.7 以及之前的版本，自增值保存在内存里<br>\\n每次重启后，第一次打开表的时候，都会去找自增值的最大值 <code>max (id)</code>，然后将 <code>max (id) + 1</code> 作为这个表当前的自增值</li>\\n<li>在 MySQL 8.0 版本，将自增值的变更记录在了 <code>redo log</code> 中，重启的时候依靠 <code>redo log</code> 恢复重启之前的值</li>\\n</ul>","autoDesc":true}');export{t as data};
